import React from 'react';
import './App.css';

const App = () => {
  return (
    <div classname='app-wrapper'>
      <header className='header'>
        <img src='https://e7.pngegg.com/pngimages/981/512/png-clipart-avengers-logo-captain-america-thor-hulk-logo-captain-america-marvel-avengers-assemble-avengers.png'/>
      </header>
      <nav className='nav'>
        <div><a>Profile</a></div>
        <div><a>Messages</a></div>
        <div><a>News</a></div>
        <div><a>Music</a></div>
        <div><a>Settings</a></div>
      </nav>
      <div classname='content'>
        Main content
      </div>
    </div>);
}


export default App;
